window.bookSummaryJSON = "<p>His code name is Nostradamus, and he’s an ancient alien super-intelligence awakened by pesky humans crawling upon his planet. He decides to use these low-grade morons, testing some, making the special ones his agents and sending them into Star Watch to make the military organization his own.</p> <p>It’s an insidious assault from within, run by a creature with fantastic predictive powers against what he considers an infantile species.</p> <p>Captain Maddox and the crew of Victory catch a glimpse of the secret menace in the Tau Ceti System. They race back to Earth to report. But Nostradamus’ web is already closing in. It may already be too late.</p> <p>Except...Maddox, Galyan, Valerie, and Professor Ludendorff refuse to give up on those they love. The secret war against humanity has a new set of champions, hardened veterans willing to challenge an alien that can predict their every move.</p> <p>Do Maddox and his crew stand a chance against the super-alien and the full weight of Star Watch turned against them? Find out in <i>The Lost Intelligence</i>, the 12th book in the Lost Starship Series.</p>"; 
